import React from 'react';
import { ModalWrapper, ModalBox } from './styles';

const Modal = ({ children, open }) => {
  return (
    <ModalWrapper>
      <ModalBox>{children}</ModalBox>
    </ModalWrapper>
  );
};

export default Modal;
